import React, { useState } from "react";
import "./EmployeeEarnings.scss";

const EmployeeEarnings = () => {
  const [ed, setEd] = useState("active");

  return (
    <div className="postJobs">
      <div className="post-box">
        <div className="header">
          <button
            style={
              ed === "active"
                ? { backgroundColor: "#1d4354", color: "white" }
                : {}
            }
            onClick={() => setEd("active")}
          >
            Total Earnings
          </button>
          <button
            style={
              ed === "rejected"
                ? { backgroundColor: "#1d4354", color: "white" }
                : {}
            }
            onClick={() => setEd("rejected")}
          >
            Pending Withdraw
          </button>
          <button
            style={
              ed === "shortlisted"
                ? { backgroundColor: "#1d4354", color: "white" }
                : {}
            }
            onClick={() => setEd("shortlisted")}
          >
            Withdraw history
          </button>
        </div>
        {/* <form  className="jobs-search">
          <input
            style={{ width: "81%" }}
            type="text"
            onChange={(e) => setKeyword(e.target.value)}
          />
          <button type="submit">Search</button>
        </form> */}

        <div className="main-body">
          {ed === "active" ? (
            <div className="earn-main-box">
              <div className="earn-box">
                Total Earned
                <strong>$</strong>
              </div>
            </div>
          ) : ed === "rejected" ? (
            "<ProposalComponent proposals={rejectedProposals} />"
          ) : ed === "shortlisted" ? (
            "<ProposalComponent proposals={shortListedProposals} />"
          ) : (
            ""
          )}
        </div>
      </div>
    </div>
  );
};

export default EmployeeEarnings;
